      cwgt = 1.d0
      do 500 ih = 0 , leub_eubmmag-1
         atmp    = cwgt*agcwrk(ih)*aprop
         agc(ih) = agc(ih) + atmp
         ancp(jgraph) = ancp(jgraph) + atmp*conjg(atmp)
  500 continue

      return
      end
